import React, { Component } from 'react';
import Logo from './img/logo.png';
import './App.css';

export class Header extends Component {
	render() {
		return (
			<div className="Header">
				<div className="nav">
					<div className="logo">
						<img src={Logo} alt=""/>
					</div>
					<div className='links'>
						<ul>
							<a href="/"><li>HOME</li></a>
							<a href="/"><li>BIKES</li></a>
							<a href="/"><li>GEAR</li></a>
							<a href="/"><li>PARTS</li></a>
							<a href="/"><li>TIRES</li></a>
							<a href="/"><li>SERVICE-INFO</li></a>
							<a href="/"><li>CATALOGUES</li></a>
							<a href="/"><li>CONTACT</li></a>
						</ul>
					</div>
				</div>				
			</div>
		);
	}
}

export default Header;
